var app=angular.module("app",[]);app.run(["$http","$window",function(n){n.defaults.headers.common["X-Requested-With"]="XMLHttpRequest";n.defaults.headers.common.__RequestVerificationToken=$("input[name=__RequestVerificationToken]").val()}]);app.service("appService",["$http",function(n){this.GetAllSelfAssessments=function(t){return n.post("Assessment/GetAllSelfAssessments",t)};this.GetFeedbackNotification=t=>n.post("Assessment/GetFeedbackNotification",t)}]);app.controller("IndexCtrl",["$scope","$window","appService","$rootScope",function(n,t,i){n.SelfAssessments=[];n.FeedbackNotification={};i.GetAllSelfAssessments({}).then(function(t){n.SelfAssessments=t.data}).catch(function(){alert("Error")});i.GetFeedbackNotification({}).then(t=>{n.FeedbackNotification=t.data}).catch(()=>{alert("Error")})}]);